function Blog({ posts }) {
  return (
    <ul>
      {posts.data.map((data) => (
        <li key={data.content.id}>{data.content.title}</li>
      ))}
    </ul>
  );
}

export async function getStaticProps() {
  // Call an external API endpoint to get posts
  const res = await fetch("https://2bxd69w7-dev.preview.zesty.io/-/instant/6-8a80f4eca3-b3t1nh.json");
  const posts = await res.json();

  // By returning { props: posts }, the Blog component
  // will receive `posts` as a prop at build time
  return {
    revalidate: 10,
    props: {
      posts,
    }
  };
}

export default Blog;
